import React from 'react';
import Seo from './seo';
import Link from 'next/link'

function menu(props) {
    return (
        <>
            <Seo />
            <nav>
                <li>
                    <Link href="/home">
                        <a>Home</a>
                    </Link>
                </li>
                <li>
                    <Link href="/sobre">
                        <a>Sobre</a>
                    </Link>
                </li>
            </nav>

            
        </>
    );
}

export default menu;
